// src/App.js
import React from 'react';
import { Route, Routes } from 'react-router-dom';
import Login from './src/components/Login'; // adjust based on actual location
import Register from './src/components/Register'; // adjust based on actual location
import Dashboard from './src/components/Dashboard'; // adjust based on actual location

function App() {
  return (
    <div className="App">
      <Routes>
        <Route path="/" element={<Login />} />
        <Route path="/register" element={<Register />} />
        <Route path="/dashboard" element={<Dashboard />} />
      </Routes>
    </div>
  );
}

export default App;
